          }}><span id='healer'>{`Healer`}</span></td>
          <td parentName="tr" {...{
            "align": null
          }}><em parentName="td">{`Internal Ops`}</em></td>
          <td parentName="tr" {...{
            "align": null
          }}>{`Assigned to members for managing internal operations of the guild.`}</td>
        </tr>
      </tbody>
    </table>
    <p>{`Notice a role (or skill) we’re missing? Suggest a new one in the `}<span class='channels'>{`#ops`}</span>{` channel and if you get soft consensus deploy it!`}</p>
    <p>{`As it stands today, Guilders holding at least one share can assign themselves any role they see fit. Please do not overassign yourself in order to give those who are highly skilled in specific areas the chance to shine. We recommend assigning a maximum of 5 roles to start and branching outwards over time.`}</p>
    <p>{`Roles will be crucial to the development and maintenance of skill-trees, which we hope will fit nicely with a web3 profile that travels with you throughout the Metaverse.  More on this later.. `}</p>
    </MDXLayout>;
}

;
